svg.desc:
#title: CsabaDu_DynamicTestData_4LayeredTestData
	#direction: down

	#.foundabstract: fill=#ccffff title=center,bold
	#.coreabstract: fill=#ccffcc title=center,italic,bold
	#.markerabstract: fill=#ffffcc title=center,italic,bold
	#.markergenabstract: fill=#ffff99 title=center,italic,bold
	#.specabstract: fill=#ffcccc title=center,italic,bold
	#.spec: fill=#ffcccc title=center,bold

	[<foundabstract>IEquatable<INamedTestCase>]

	[<foundabstract>INamedTestCase]

	[<coreabstract> ITestData]

	[<foundabstract>NamedTestCase]

	[<coreabstract>TestDataBase]

	[<specabstract>TestData]

	[<spec>TestData<T1>]

	[<spec>TestData<T1, T2>]

	[<spec>TestData<T1, T2, ..., T9>]

	[<specabstract>TestDataReturns<TStruct>]


	[<specabstract>TestDataThrows<TException>]

	[<markerabstract>TestDataExpected<TResult> ]

	[<markerabstract> IExpected]

	[<markerabstract> IReturns]


	[<markerabstract> IExpected<out TResult>
	where TResult: notnull]

	[<markerabstract>IThrows]

	[<markerabstract> IReturns<out TStruct>
	where TStruct: struct]

	[<markerabstract> IThrows<out TException>
	where TException: Exception]


	[<spec>TestDataReturns<TStruct, T1>]

	[<spec>TestDataThrows<TException, T1>]

	[<spec>TestDataReturns<TStruct, T1, T2>]

	[<spec>TestDataThrows<TException, T1, T2>]

	[<spec>TestDataReturns<TStruct, T1, T2, ..., T9>]

	[<spec>TestDataThrows<TException, T1, T2, ..., T9>]


	// diagram


	[
	TestData<T1, T2, ..., T9>
	] -:> [
	TestData<T1, T2>
	]

	[
	IEquatable<INamedTestCase>
	] <:- [
	INamedTestCase
	]

	[
	TestData<T1, T2>
	] -:> [
	TestData<T1>
	]

	[
	TestData<T1>
	] -:> [
	TestData
	]

	[
	TestData
	] -:> [
	TestDataBase
	]

	[
	INamedTestCase
	] <:-- [
	NamedTestCase
	]

	[
	INamedTestCase
	] <:- [
	ITestData
	]

	[
	ITestData
	] <:-- [
	TestDataBase
	]

	[
	NamedTestCase
	] <:- [
	TestDataBase
	]

	[
	TestDataBase
	] <:- [
	TestDataExpected<TResult>
	]

	[
	TestDataExpected<TResult>
	] <:- [
	TestDataReturns<TStruct>
	]

	[
	TestDataExpected<TResult>
	] --:> [
	IExpected<out TResult>
	]



	[
	TestDataExpected<TResult>
	] <:- [
	TestDataThrows<TException>
	]

	[
	TestDataReturns<TStruct>
	] <:- [
	TestDataReturns<TStruct, T1>
	]

	[
	TestDataReturns<TStruct>
	] --:> [
	IReturns<out TStruct>
	]

	[
	IReturns<out TStruct>
	] -:> [
	IReturns
	]

	[
	IReturns<out TStruct>
	] -:>
	[
	IExpected<out TResult>
	]

	[
	IExpected<out TResult>
	] -:> [
	IExpected
	]

	[
	IThrows<out TException>
	] -:>
	[
	IExpected<out TResult>
	]

	[
	TestDataThrows<TException>
	] --:> [
	IThrows<out TException>
	]

	[
	TestDataThrows<TException>
	] <:- [
	TestDataThrows<TException, T1>
	]

	[
	TestDataReturns<TStruct, T1>
	] <:- [
	TestDataReturns<TStruct, T1, T2>
	]

	[
	IReturns
	] -:> [
	IExpected
	]

	[
	IThrows
	] -:> [
	IExpected
	]

	[
	IThrows<out TException>
	] -:> [
	IThrows
	]

	[
	TestDataThrows<TException, T1>
	] <:- [
	TestDataThrows<TException, T1, T2>
	]

	[
	TestDataReturns<TStruct, T1, T2>
	] <:- [
	TestDataReturns<TStruct, T1, T2, ..., T9>
	]

	[
	TestDataThrows<TException, T1, T2>
	] <:- [
	TestDataThrows<TException, T1, T2, ..., T9>
	]
